my %list2 = (
    # name => [gender => gender ratio, sample ratio, not a name?]
    wati => [f => 1, -1],
);

$list{$_} = $list2{$_} for keys %list2;

sub guess_gender {
    my $opts;
    if (@_ && ref($_[0]) eq 'HASH') {
        $opts = shift;
    } else {
        $opts = {};
    }
    die "Please specify at least 1 name" unless @_;

    my @res;
    for my $name (@_) {
        do { push @res, undef; next } unless defined($name);
        my $res = { success => 0 };

        if (my $l = $list{$name}) {
            $res->{success} = 1;
            my $r = $l->[1];
            $res->{result} = $r < 0.7 ? "both" : uc($l->[0]);
            $res->{gender_ratio} = $r;
            $res->{guess_confidence} = 1;
            $res->{sample_ratio} = $l->[2];
            $res->{not_a_name} = 1 if $l->[3];
        } else {
            $res->{error} = "Not found in list of common names";
        }
        push @res, $res;
    }
    @res;
}

1;
#ABSTRACT: common

=head1 FUNCTIONS

=head2 guess_gender([OPTS, ]FIRSTNAME...) => RES, ...

Guess the gender of given first name(s). An optional hashref OPTS can
be given as the first argument. Valid pair for OPTS:

=over 4

=back

Will return a result hashref RES for each given input. Known pair of
RES:

=over 4

=item success => BOOL

Whether the algorithm succeeds. If the name is not found in the list,
will return 0.

=item result => "M" or "F" or "both" or "neither" or undef.

=item gender_ratio => FRACTION

=item min_gender_ratio => FRACTION

=item guess_confidence => FRACTION

=item sample_ratio => INT

=back

=cut
